import React from 'react';

const Header = () => {
  return (
    <div>
      <h1>Sports Central</h1>
      <nav>
        <a href="#home">Home</a>
        <a href="#news">Trending News</a>
        <a href="#feeds">Live Feeds</a>
        <a href="#polls">Polls and Voting</a>
        <a href="#articles">Sports Article</a>
      </nav>
    </div>
  );
};

export default Header;
